    "2016-07-27T23:06:10.108209",nt"name": "lewis-and-clark-nwr-initial-survey-instructions-for-resident-dark-goose-rdg-banding-protoc",nt"isopen":
    false,nt"url": null,nt"notes": "In the 1960s the USFWS and WDFW attempted
    to translocate Dusky Canada geese to the lower islands of the Lewis and Clark NWR.
     The birds hybridized with Western Canada Geese and formed a resident population
    of dark geese that are difficult to distinguish from the nonhunted Dusky Canada
    geese.  WDFW has been gathering information on these Resident Dark Geese (RDGs)
    by identifying nesting patterns and collaring adults and juveniles.  Collaring birds
    gives information on wintering movements and allows biologists to radio tag birds.
     Collaring geese also signals to hunters that they are not Dusky Canada Geese and
    can be harvested.  The refuge participates in these WDFW-led collaring efforts because
    they occur within the Lewis and Clark NWR Boundary and because the initial translocation
    attempt was sponsored by the USFWS.",nt"license_title": "License Not Specified",nt"extras":
